import React from "react";

function Third() {
  let products = new Array();
  products = [1, 2, 3, 4];
  return (
    <div>
      <center>
        <h2 style={{ marginBottom: "40px" }}>
          New <b>Products</b>
        </h2>
      </center>
      <div className="container-xl d-flex justify-content-center">
        <div className="row">
          {products.map(() => {
            return (
              <div className="card m-2" style={{ width: "18rem" }}>
                <img
                  className="card-img-top"
                  src={
                    "https://images.unsplash.com/photo-1542291026-7eec264c27ff?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8OXx8cHJvZHVjdHxlbnwwfHwwfHw%3D&w=1000&q=80"
                  }
                  alt="Card image cap"
                />
                <div className="card-body">
                  <h5 className="card-title">Card title</h5>
                  <p className="card-text">
                    Some quick example text to build on the card title and make
                    up the bulk of the card's content.
                  </p>
                  <a href="#" className="btn btn-dark center">
                    Go somewhere
                  </a>
                </div>
              </div>
            );
          })}
        </div>
      </div>
    </div>
  );
}

export default Third;
